import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on jun_2 listing card
    await page.waitForSelector('[data-listing-id="jun_2"]');
    await page.click('[data-listing-id="jun_2"]');

    // Wait for modal to appear and take screenshot
    await page.waitForSelector('.modal-overlay', { state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_opened.png'));

    // Extract modal title text
    const modalTitle = await page.textContent('#modal-title');

    return {
      success: true,
      action: "Clicked jun_2 listing card and verified modal title",
      extractedData: {
        modalTitle: modalTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for listings to load
    await page.waitForSelector('[data-listing-id]', { timeout: 10000 });

    // Find and click the jun_2 listing card using data attribute selector
    const jun2Card = await page.$('[data-listing-id="jun_2"]');
    if (!jun2Card) {
      throw new Error('jun_2 listing card not found');
    }

    await jun2Card.click();
    await page.waitForTimeout(1000);

    // Wait for modal to appear using multiple selector strategies
    await page.waitForSelector('.modal-overlay', { state: 'visible', timeout: 5000 });
    await page.waitForSelector('#modal-title', { state: 'visible', timeout: 5000 });

    // Take screenshot of modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract modal title text
    const modalTitle = await page.$eval('#modal-title', el => el.textContent.trim());

    // Verify modal title is not empty
    if (!modalTitle) {
      throw new Error('Modal title is empty');
    }

    return {
      success: true,
      action: "Successfully clicked jun_2 listing card and verified modal title",
      extractedData: {
        modalTitle: modalTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

